import React from 'react';
import {
  Button,
  Form,
  FormGroup,
  Label,
  Input,
  FormText,
  Container,
  Row,
  Col,
  TabContent,
  TabPane,
  Nav,
  NavItem,
  NavLink,
  Card,
  CardTitle,
  CardText,
  ListGroup,
  ListGroupItem
} from 'reactstrap';
import classnames from 'classnames';

import Head from 'next/head';
import SignatureCanvas from 'react-signature-canvas';

class Signature extends React.Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      activeTab: '1'
    };
  }

  toggle(tab) {
    if (this.state.activeTab !== tab) {
      this.setState({
        activeTab: tab
      });
    }
  }

  render() {
    return (
      <>
        <Head>
          <link rel="stylesheet" href="/static/css/bootstrap.min.css" />
        </Head>

        <Container>
          <Row>
            <Col xs="3">
              <ListGroup>
                <ListGroupItem active tag="button" action>
                  Cras justo odio
                </ListGroupItem>
                <ListGroupItem tag="button" action>
                  Dapibus ac facilisis in
                </ListGroupItem>
                <ListGroupItem tag="button" action>
                  Morbi leo risus
                </ListGroupItem>
                <ListGroupItem tag="button" action>
                  Porta ac consectetur ac
                </ListGroupItem>
                <ListGroupItem disabled tag="button" action>
                  Vestibulum at eros
                </ListGroupItem>
              </ListGroup>

              <Row>
                <Button
                  className={classnames({
                    active: this.state.activeTab === '1'
                  })}
                  onClick={() => {
                    this.toggle('1');
                  }}
                >
                  Tab1
                </Button>
              </Row>
              <Row>
                <Button
                  className={classnames({
                    active: this.state.activeTab === '2'
                  })}
                  onClick={() => {
                    this.toggle('2');
                  }}
                >
                  Moar Tabs
                </Button>
              </Row>
            </Col>

            {/* Tab Content column */}
            <Col>
              <TabContent activeTab={this.state.activeTab}>
                <TabPane tabId="1">
                  <Row>
                    <Col sm="12">
                      <h4>Tab 1 Contents</h4>
                    </Col>
                  </Row>
                </TabPane>
                <TabPane tabId="2">
                  <Row>
                    <Col sm="6">
                      <Card body>
                        <CardTitle>Special Title Treatment</CardTitle>
                        <CardText>
                          With supporting text below as a natural lead-in to
                          additional content.
                        </CardText>
                        <Button>Go somewhere</Button>
                      </Card>
                    </Col>
                    <Col sm="6">
                      <Card body>
                        <CardTitle>Special Title Treatment</CardTitle>
                        <CardText>
                          With supporting text below as a natural lead-in to
                          additional content.
                        </CardText>
                        <Button>Go somewhere</Button>
                      </Card>
                    </Col>
                  </Row>
                </TabPane>
              </TabContent>
            </Col>
          </Row>
        </Container>
      </>
    );
  }
}

export default Signature;
